import React from 'react'
import './Header.css'

class Header extends React.Component {
    render () {
        return (
            <header>
                <div className="logo">
                    <img src="./logo.png" alt="Bookmarker" />
                </div>
                <div className="plusButton">
                    <img src="./plus-button.png" alt="plus button" />
                </div>
            </header>
        )
    }
}

export default Header
